import React from 'react';
import HomePage from './pages/homepage.component';
import { Route, Link } from 'react-router-dom';
import './App.css';

const HatsPage = () => (
  <div>
    <h1>HatsPage</h1>
  </div>
)

const Home = (props) => {
  console.log(props)
  return (
    <div>
      <Link to='/topics'>Topics</Link>
      <button onClick={() => props.history.push('/topics', {data: 'Hello world'})}>Topics By History</button>
      <h1>Home Page</h1>
    </div>
  );  
}

const Topics = (props) => {
  console.log(props)
  return <h1>Topics Page</h1>
}

const TopicsDetail = props => {
  console.log(props)
  return <h1>Topic Detail Page :: {props.match.params.topicId}</h1>
}

function App() {
  return (
    <div>
      {/* <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/hatspage" component={HatsPage} />  
      </Switch>       */}

      <Route exact path="/" component={Home} />
      <Route exact path="/topics" component={Topics} />
      <Route exact path="/topics/:topicId" component={TopicsDetail} />
    </div>
  );
}

export default App;
